items.text:
A Model or Entity represents some object that your application manages. For example, one
might define a Model for Users, Products, Cars, or other real-world object that we want
to model in the system. Models are used by <a href='#!/api/Ext.data.Store'>Ext.data.Store</a>, which are in
turn used by many of the data-bound components in Ext.

# Fields

Models are defined as a set of fields and any arbitrary methods and properties relevant
to the model. For example:

    Ext.define('User', {
        extend: 'Ext.data.Model',
        fields: [
            {name: 'name',  type: 'string'},
            {name: 'age',   type: 'int', convert: null},
            {name: 'phone', type: 'string'},
            {name: 'alive', type: 'boolean', defaultValue: true, convert: null}
        ],

        changeName: function() {
            var oldName = this.get('name'),
                newName = oldName + " The Barbarian";

            this.set('name', newName);
        }
    });

Now we can create instances of our User model and call any model logic we defined:

    var user = Ext.create('User', {
        id   : 'ABCD12345',
        name : 'Conan',
        age  : 24,
        phone: '555-555-5555'
    });

    user.changeName();
    user.get('name'); //returns "Conan The Barbarian"

By default, the built in field types such as number and boolean coerce string values
in the raw data by virtue of their <a href='#!/api/Ext.data.field.Field-method-convert'>Ext.data.field.Field#method-convert</a> method.
When the server can be relied upon to send data in a format that does not need to be
converted, disabling this can improve performance. The <a href='#!/api/Ext.data.reader.Json'>Ext.data.reader.Json</a>
and <a href='#!/api/Ext.data.reader.Array'>Ext.data.reader.Array</a> readers are likely candidates for this
optimization. To disable field conversions you simply specify <a href='#!/api/null'>null</a> for the field's
<a href='#!/api/Ext.data.field.Field-cfg-convert'>Ext.data.field.Field#cfg-convert</a>.

## The "id" Field and <a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a>

A Model definition always has an *identifying field* which should yield a unique key
for each instance. By default, a field named "id" will be created with a
<a href='#!/api/Ext.data.field.Field-cfg-mapping'>Ext.data.Field#mapping</a> of "id". This happens because of the default
<a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a> provided in Model definitions.

To alter which field is the identifying field, use the <a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a> config.

# Validators

Models have built-in support for field validators. Validators are added to models as in
the follow example:

    Ext.define('User', {
        extend: 'Ext.data.Model',
        fields: [
            { name: 'name',     type: 'string' },
            { name: 'age',      type: 'int' },
            { name: 'phone',    type: 'string' },
            { name: 'gender',   type: 'string' },
            { name: 'username', type: 'string' },
            { name: 'alive',    type: 'boolean', defaultValue: true }
        ],

        validators: {
            age: 'presence',
            name: { type: 'length', min: 2 },
            gender: { type: 'inclusion', list: ['Male', 'Female'] },
            username: [
                { type: 'exclusion', list: ['Admin', 'Operator'] },
                { type: 'format', matcher: /([a-z]+)[0-9]{2,3}/i }
            ]
        }
    });

The derived type of <a href='#!/api/Ext.data.field.Field'>Ext.data.field.Field</a> can also provide validation. If <a href='#!/api/Ext.data.Model-cfg-validators'>validators</a>
need to be duplicated on multiple fields, instead consider creating a custom field type.

## Validation

The results of the validators can be retrieved via the "associated" validation record:

    var instance = Ext.create('User', {
        name: 'Ed',
        gender: 'Male',
        username: 'edspencer'
    });

    var validation = instance.getValidation();

The returned object is an instance of <a href='#!/api/Ext.data.Validation'>Ext.data.Validation</a> and has as its fields the
result of the field <a href='#!/api/Ext.data.Model-cfg-validators'>validators</a>. The validation object is "dirty" if there are one or
more validation errors present.

This record is also available when using data binding as a "pseudo-association" called
"validation". This pseudo-association can be hidden by an explicitly declared
association by the same name (for compatibility reasons), but doing so is not
recommended.

The <a href='#!/api/Ext.Component-cfg-modelValidation'>Ext.Component#modelValidation</a> config can be used to enable automatic
binding from the "validation" of a record to the form fields that may be bound to its
values.

# Associations

Models often have associations with other Models. These associations can be defined by
fields (often called "foreign keys") or by other data such as a many-to-many (or "matrix").

## Foreign-Key Associations - One-to-Many

The simplest way to define an association from one Model to another is to add a
<a href='#!/api/Ext.data.field.Field-cfg-reference'>Ext.data.field.Field#cfg-reference</a> to the appropriate field.

     Ext.define('Post', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'user_id', reference: 'User' }
         ]
     });

     Ext.define('Comment', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'user_id', reference: 'User' },
             { name: 'post_id', reference: 'Post' }
         ]
     });

     Ext.define('User', {
         extend: 'Ext.data.Model',

         fields: [
             'name'
         ]
     });

The placement of `reference` on the appropriate fields tells the Model which field has
the foreign-key and the type of Model it identifies. That is, the value of these fields
is set to value of the <a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a> field of the target Model.

### One-to-Many Without Foreign-Keys

To define an association without a foreign-key field, you will need to use either the
<a href='#!/api/Ext.data.Model-cfg-hasMany'>cfg-hasMany</a> or <a href='#!/api/Ext.data.Model-cfg-belongsTo'>cfg-belongsTo</a>.

     Ext.define('Post', {
         extend: 'Ext.data.Model',

         belongsTo: 'User'
     });

     Ext.define('Comment', {
         extend: 'Ext.data.Model',

         belongsTo: [ 'Post', 'User' ]
     });

     // User is as above

These declarations have changed slightly from previous releases. In previous releases
both "sides" of an association had to declare their particular roles. This is now only
required if the defaults assumed for names are not satisfactory.

## Foreign-Key Associations - One-to-One

A special case of one-to-many associations is the one-to-one case. This is defined as
a <a href='#!/api/Ext.data.field.Field-cfg-reference'>Ext.data.field.Field#reference</a>.

     Ext.define('Address', {
         extend: 'Ext.data.Model',

         fields: [
             'address',
             'city',
             'state'
         ]
     });

     Ext.define('User', {
         extend: 'Ext.data.Model',

         fields: [{
             name: 'addressId',
             reference: 'Address',
             unique: true
         }]
     });

## Many-to-Many

The classic use case for many-to-many is a User and Group. Users can belong to many
Groups and Groups can contain many Users. This association is declared using the
<a href='#!/api/Ext.data.Model-cfg-manyToMany'>cfg-manyToMany</a> config like so:


     Ext.define('User', {
         extend: 'Ext.data.Model',

         fields: [
             'name'
         ],

         manyToMany: 'Group'
     });

     Ext.define('Group', {
         extend: 'Ext.data.Model',

         fields: [
             'name'
         ],

         manyToMany: 'User'
     });

As with other associations, only one "side" needs to be declared.

To manage the relationship between a <a href='#!/api/Ext.data.Model-cfg-manyToMany'>manyToMany</a> relationship, a <a href='#!/api/Ext.data.Session'>Ext.data.Session</a>
must be used.

# Using a Proxy

Models are great for representing types of data and relationships, but sooner or later we're going to want to load or
save that data somewhere. All loading and saving of data is handled via a <a href='#!/api/Ext.data.proxy.Proxy'>Ext.data.proxy.Proxy</a>, which
can be set directly on the Model:

    Ext.define('User', {
        extend: 'Ext.data.Model',
        fields: ['id', 'name', 'email'],

        proxy: {
            type: 'rest',
            url : '/users'
        }
    });

Here we've set up a <a href='#!/api/Ext.data.proxy.Rest'>Ext.data.proxy.Rest</a>, which knows how to load and save data to and from a
RESTful backend. Let's see how this works:

    var user = Ext.create('User', {name: 'Ed Spencer', email: 'ed@sencha.com'});

    user.save(); //POST /users

Calling <a href='#!/api/Ext.data.Model-method-save'>save</a> on the new Model instance tells the configured RestProxy that we wish to persist this Model's
data onto our server. RestProxy figures out that this Model hasn't been saved before because it doesn't have an id,
and performs the appropriate action - in this case issuing a POST request to the url we configured (/users). We
configure any Proxy on any Model and always follow this API - see <a href='#!/api/Ext.data.proxy.Proxy'>Ext.data.proxy.Proxy</a> for a full list.

Loading data via the Proxy is accomplished with the static `load` method:

    //Uses the configured RestProxy to make a GET request to /users/123
    User.load(123, {
        success: function(user) {
            console.log(user.getId()); //logs 123
        }
    });

Models can also be updated and destroyed easily:

    //the user Model we loaded in the last snippet:
    user.set('name', 'Edward Spencer');

    //tells the Proxy to save the Model. In this case it will perform a PUT request to /users/123 as this Model already has an id
    user.save({
        success: function() {
            console.log('The User was updated');
        }
    });

    //tells the Proxy to destroy the Model. Performs a DELETE request to /users/123
    user.erase({
        success: function() {
            console.log('The User was destroyed!');
        }
    });

# HTTP Parameter names when using a <a href='#!/api/Ext.data.proxy.Ajax'>Ext.data.proxy.Ajax</a>

By default, the model ID is specified in an HTTP parameter named `id`. To change the
name of this parameter use the Proxy's <a href='#!/api/Ext.data.proxy.Ajax-cfg-idParam'>Ext.data.proxy.Ajax#idParam</a>
configuration.

Parameters for other commonly passed values such as
<a href='#!/api/Ext.data.proxy.Ajax-cfg-pageParam'>Ext.data.proxy.Ajax#pageParam</a> or
<a href='#!/api/Ext.data.proxy.Ajax-cfg-startParam'>Ext.data.proxy.Ajax#startParam</a> may also be configured.

# Usage in Stores

It is very common to want to load a set of Model instances to be displayed and manipulated in the UI. We do this by
creating a <a href='#!/api/Ext.data.Store'>Ext.data.Store</a>:

    var store = Ext.create('Ext.data.Store', {
        model: 'User'
    });

    //uses the Proxy we set up on Model to load the Store data
    store.load();

A Store is just a collection of Model instances - usually loaded from a server somewhere. Store can also maintain a
set of added, updated and removed Model instances to be synchronized with the server via the Proxy. See the <a href='#!/api/Ext.data.Store'>Ext.data.Store</a> for more information on Stores.

Set to `false` to prevent any converters from being called on fields specified in
a <a href='#!/api/Ext.data.Model-method-set'>Ext.data.Model#set</a> operation.

**Note:** Setting the config to `false` will only prevent the convert / calculate
call when the set `fieldName` param matches the field's <a href='#!/api/Ext.data.Model-name'>name</a>.  In the
following example the calls to set `salary` will not execute the convert method
on <a href='#!/api/Ext.data.Model-method-set'>set</a> while the calls to set `vested` will execute the convert method on the
initial read as well as on <a href='#!/api/Ext.data.Model-method-set'>set</a>.

Example model definition:

    Ext.define('MyApp.model.Employee', {
        extend: 'Ext.data.Model',
        fields: ['yearsOfService', {
            name: 'salary',
            convert: function (val) {
                var startingBonus = val * .1;
                return val + startingBonus;
            }
        }, {
            name: 'vested',
            convert: function (val, record) {
                return record.get('yearsOfService') >= 4;
            },
            depends: 'yearsOfService'
        }],
        convertOnSet: false
    });

    var tina = Ext.create('MyApp.model.Employee', {
        salary: 50000,
        yearsOfService: 3
    });

    console.log(tina.get('salary')); // logs 55000
    console.log(tina.get('vested')); // logs false

    tina.set({
        salary: 60000,
        yearsOfService: 4
    });
    console.log(tina.get('salary')); // logs 60000
    console.log(tina.get('vested')); // logs true

The id generator to use for this model. The <a href='#!/api/Ext.data.Model-cfg-identifier'>identifier</a> generates values for the
<a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a> when no value is given. Records with client-side generated
values for <a href='#!/api/Ext.data.Model-cfg-idProperty'>idProperty</a> are called <a href='#!/api/Ext.data.Model-property-phantom'>phantom</a> records since they are
not yet known to the server.

This can be overridden at the model level to provide a custom generator for a model.
The simplest form of this would be:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         requires: ['Ext.data.identifier.Sequential'],
         identifier: 'sequential',
         ...
     });

The above would generate <a href='#!/api/Ext.data.identifier.Sequential'>Ext.data.identifier.Sequential</a> id's such
as 1, 2, 3 etc..

Another useful id generator is <a href='#!/api/Ext.data.identifier.Uuid'>Ext.data.identifier.Uuid</a>:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         requires: ['Ext.data.identifier.Uuid'],
         identifier: 'uuid',
         ...
     });

An id generator can also be further configured:

     Ext.define('MyApp.data.MyModel', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             seed: 1000,
             prefix: 'ID_'
         }
     });

The above would generate id's such as ID_1000, ID_1001, ID_1002 etc..

If multiple models share an id space, a single generator can be shared:

     Ext.define('MyApp.data.MyModelX', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             id: 'xy'
         }
     });

     Ext.define('MyApp.data.MyModelY', {
         extend: 'Ext.data.Model',
         identifier: {
             type: 'sequential',
             id: 'xy'
         }
     });

For more complex, shared id generators, a custom generator is the best approach.
See <a href='#!/api/Ext.data.identifier.Generator'>Ext.data.identifier.Generator</a> for details on creating custom id generators.

The name of the field treated as this Model's unique id.

If changing the idProperty in a subclass, the generated id field will replace the one
generated by the superclass, for example;

     Ext.define('Super', {
         extend: 'Ext.data.Model',
         fields: ['name']
     });

     Ext.define('Sub', {
         extend: 'Super',
         idProperty: 'customId'
     });

     var fields = Super.getFields();
     // Has 2 fields, "name" & "id"
     console.log(fields[0].name, fields[1].name, fields.length);

     fields = Sub.getFields();
     // Has 2 fields, "name" & "customId", "id" is replaced
     console.log(fields[0].name, fields[1].name, fields.length);

The data values for this field must be unique or there will be id value collisions
in the <a href='#!/api/Ext.data.Store'>Ext.data.Store</a>.

